	public sealed class MonsterDb
	{
#pragma warning disable 0649
		[Serializable]
		private struct MonsterDataDeserialize
		{
			public MonsterData[] Monsters;
		}

		[Serializable]
		public struct MonsterData
		{
			public MonsterSpriteIDs sprId;
			public string name;
		}
#pragma warning restore 0649

		public static readonly float[] MonsterShadows = new float[(int)MonsterSpriteIDs.Last + 1];

		public static readonly MonsterData[] Monsters;

		static MonsterDb()
		{
			#region MOB_SHADOW_INIT
			for (int i = 0; i < (int)MonsterSpriteIDs.None; i++)
				MonsterShadows[i] = 1; //set default to all first
									   //Set customized shadows. Monsters that have default don't need to be here
			MonsterShadows[(int)MonsterSpriteIDs.AbysmalKnight] = 5f;
			MonsterShadows[(int)MonsterSpriteIDs.BluePlant] = 0f;
			MonsterShadows[(int)MonsterSpriteIDs.GreenPlant] = 0f;
			MonsterShadows[(int)MonsterSpriteIDs.ShiningPlant] = 0f;
			MonsterShadows[(int)MonsterSpriteIDs.BlackMushroom] = 0f;
			MonsterShadows[(int)MonsterSpriteIDs.GiantWhisper] = 2f;
			MonsterShadows[(int)MonsterSpriteIDs.Rideword] = 0.5f;
			#endregion

			TextAsset jsonFile = AssetBundleProvider.LoadMiscBundleAsset<TextAsset>("monsterDb");
			Monsters = JsonUtility.FromJson<MonsterDataDeserialize>(jsonFile.text).Monsters;
		}
	}
